import Input from "@mui/material/Input";
function InputForm({type, name, handleOnChange}){
    return(
        <Input
            id={name}
            name={name}
            type={type}
            aria-describedby="my-helper-text"
            onChange={handleOnChange}
      />
    )
}

export default InputForm
